import React from 'react';
import {Add,Sub,mult,div} from './Calc';


function App(){
return(
    <>
    <div className = "main_box">
        <div className = "leftDiv"> </div>
        <div className = "rightDiv"> 
            <h1 className = "heading">Calculate Amount :)</h1>,
            <h2>Add : {Add(60,4)}</h2>,
            <h2>sub : {Sub(60,4)}</h2>,
            <h2>mult : {mult(60,4)}</h2>,
            <h2>div: {div(60,3.5)}</h2>
        </div>
    </div>
    </>
);
}

export default App;
